#include <stdio.h>
#include <string.h>
#include<stdlib.h>
#define MAX 500
#define START 2
#define END 3
struct maze{
	long int count,up,down,left,right,i,j;
	char dir[10];
};
int main()
{
	long int f=0,i,j,m,n,k,top=0,temp;
	scanf("%ld %ld",&m,&n);
	long int a[MAX][MAX];
	char maz[MAX][MAX];
	struct maze stk[n*m*2];
	for(k=0;k<(m*n*2);k++){
		stk[k].up=0;
		stk[k].down=0;
		stk[k].right=0;
		stk[k].left=0;
		stk[k].count=0;
		stk[k].i=0;
		stk[k].j=0;
	}
	for(i=0;i<m;i++)
	  for(j=0;j<n;j++)
	    scanf("%ld",&a[i][j]);
	for(i=0;i<m;i++)
	  for(j=0;j<n;j++){
	    if(a[i][j]==START){
		    f+=1;
		    stk[top].i=i;
		    stk[top++].j=j;
	    }
	    else if(a[i][j]==END)
	      f+=1;
    }
	i=stk[top-1].i;
	j=stk[top-1].j;
	if(f==2){
		while(1){
			if(a[i][j]==END){
				stk[top].i=i;
				stk[top].j=j;
				strcpy(stk[top].dir,"END");
				break;
			}
			if(i+1<m && (a[i+1][j]==1 || a[i+1][j]==END) && stk[top-1].i!=i+1){
				stk[top].down=1;
				stk[top].count+=1;
			}
			if(j+1<n && (a[i][j+1]==1 || a[i][j+1]==END) && stk[top-1].j!=j+1){
				stk[top].right=1;
				stk[top].count+=1;
			}
			if(j>0 && (a[i][j-1]==1 || a[i][j-1]==END) && stk[top-1].j!=j-1){
				stk[top].left=1;
				stk[top].count+=1;
			}
			if(i>0 && (a[i-1][j]==1 || a[i-1][j]==END) && stk[top-1].i!=i-1){
				stk[top].up=1;
				stk[top].count+=1;
			}
			stk[top].i=i;
			stk[top].j=j;
			if(stk[top].right==1 && stk[top].count>0){
				strcpy(stk[top].dir,"Right");
				j++;
				top+=1;
				continue;
			}
			else if(stk[top].left==1 && stk[top].count>0){
				strcpy(stk[top].dir,"Left");
				j--;
				top+=1;
				continue;
			} 
			else if(stk[top].down==1 && stk[top].count>0){
				strcpy(stk[top].dir,"Down");
				i++;
				top+=1;
				continue;
			} 
			else if(stk[top].up==1 && stk[top].count>0){
				strcpy(stk[top].dir,"Up");
				i--;
				top+=1;
				continue;
			}
			if(stk[top].count==0){
				temp=top;
				while(stk[top].count<2){
					if(top==0 && stk[top].count<2){
						printf("No route Exits!!!\n");
						exit(0);
					}
					top-=1;
				}
				i=stk[top].i;
				j=stk[top].j;
				stk[top].count=0;
				a[stk[top+1].i][stk[top+1].j]=0;
				for(int z=top;z<temp;z++){
					stk[z].count=0;
					stk[z].up=0;
					stk[z].down=0;
					stk[z].right=0;
					stk[z].left=0;
				}
			}
		}
		printf("\nDirected Solution : \n");
		for(i=0;i<m;i++)
		for(j=0;j<n;j++)
		maz[i][j]='.';
		for(int o=0;o<=top;o++){
			printf("%s ",stk[o].dir);
			maz[stk[o].i][stk[o].j]='*';
		}  
		maz[stk[0].i][stk[0].j]='S';
		maz[stk[top].i][stk[top].j]='E';
		printf("\n\nGraphical Solution : ");
		printf("\n");     
		for(i=0;i<m;i++){
			for(j=0;j<n;j++)
			printf("%c ",maz[i][j]);
			printf("\n");
		}
	}
	else
	printf("WRONG INPUT!!");
	return 0;
}
